import React from 'react';


function CameraMaster(){
    return(
        <div>
            <p style={{textAlign: 'center'}}>Enter Camera URL here: <input type="text"></input></p>
            <ControlCenter/>
        </div>
    )
}
function ControlCenter(){
    return(
        <div style={{textAlign: 'center'}}>
            <p>Cameras</p>
        </div>
    )
}
export default CameraMaster;
